import React, { Component } from "react";
import Popup from "reactjs-popup";


class Allocation extends Component {
	render() {
		return (
			<div class="container">
				<br></br>

				<h3 class="display-1" headerTitleStyle>Allocation</h3>

				<br></br><br></br>

				
			</div>
		);
	}
}

export default Allocation;


